import React from 'react';

var moment = require('moment');
var date = moment().format('MMMM Do YYYY, h:mm:ss a');

export default ({styles}) => {
    return (
        <div style={styles.channels}>
            <p id="currentdate"> </p>
        </div>
    )
}

document.getElementById("currentdate").innerHTML = date;
